sources.components\\checkbox\\checkbox.scss:
.checkbox {
	&__label {
		max-width: 240px;
		margin-top: 10px;
		position: relative;
		color: $color-ds50;
		padding-left: 30px;
		line-height: 1.3rem;
		cursor: pointer;

	}

	&__input {
		display: none;

		&:hover {
			&+.checkbox__check-icon {
				border-color: $color-purple;
			}
		}
	}

	&__check-icon {
		position: absolute;
		left: 0px;
		border: 1px solid $color-ds25;
		font-size: inherit;
		font-weight: bolder;
		user-select: none;
		width: 20px;
		height: 20px;
		border-radius: 4px;
		padding: 3px;
		background-image: rgba(0, 0, 0, 1);
		background-clip: text;
		-webkit-background-clip: text;
		-webkit-text-fill-color: transparent;
	}

	&__input:checked {
		&+.checkbox__check-icon {
			background-image: $color-purple-gradient;
			border-color: $color-purple;
		}
	}
}

.label-check {
	display: block;
	margin-bottom: 12px;
	min-width: 200px;
	cursor: pointer;
	margin-left: 30px;
	position: relative;
	font-weight: normal;
	font-size: 14px;
	line-height: 18px;
	color: $color-ds50;
}

/* C   */
.label-check__input {
	display: none;
}

/*   */
.label-check__new-input {
	position: absolute;
	left: -30px;
	top: -1px;
	font-family: Montserrat;
	font-style: normal;
	font-weight: normal;
	font-size: 14px;
	line-height: 18px;
	color: $color-ds50;
	width: 20px;
	height: 20px;

	background: #FFFFFF;

	border: 1px solid $color-ds25;
	box-sizing: border-box;
	border-radius: 4px;
}

/*     */
.label-check__input:checked+.label-check__new-input {
	border-color: $color-purple;

	.check-item {
		display: block;
	}
}

.check-item {
	display: none;
	position: absolute;
	top: 4px;
	left: 6px;
	width: 6px;
	height: 8px;
	border-right: 2px solid transparent;
	border-bottom: 2px solid transparent;
	transform: rotate(45deg);
	border-image: $color-purple-gradient;
	-moz-border-image: $color-purple-gradient;
	-webkit-border-image: $color-purple-gradient;
	border-image-slice: 1;
}

.expandable-checkbox {
	position: relative;
	width: 100%;
	min-width: 250px;
	cursor: pointer;

	&__header {
		margin-bottom: 18px;
		font-weight: bold;
		font-size: 12px;
		line-height: 15px;
		text-transform: uppercase;
		color: $color-ds100;

	}

	// &__list {
	//     // display: none;
	// }

	&__arrow {
		position: absolute;
		top: -5px;
		right: 16px;
		font-weight: normal;
		font-size: 24px;
		line-height: 24px;
		color: $color-ds50;
	}

	&__list-item {
		margin-bottom: 10px;
	}

	&--active {
		.expandable-checkbox__list {
			display: block;
		}

		>.expandable-checkbox__arrow {
			transform: rotate(180deg);
		}
	}
}

.expandable-checkbox.expandable-checbox--active>.expandable-checkbox__arrow {
	transform: rotate(180deg);
}

.label-check-rich {
	@extend .label-check;
	font-weight: bold;
	margin-bottom: 10px;
	color: $color-ds75;

	&__input {
		@extend .label-check__input;
	}

	&__new-input {
		@extend .label-check__new-input;
	}

	&__description {
		font-weight: normal;
		font-size: 12px;
		line-height: 14px;
		color: $color-ds50;
		margin-top: 6px;
	}
}

sources.components\\radiobutton\\radiobutton.scs:
.label-radio {
	display: inline-block;
	cursor: pointer;
	position: relative;
	padding-left: 30px;

	&__text {
		line-height: 24px;
		color: $color-ds50;
		margin-bottom: 0;

		&:before {
			position: absolute;
			left: 0;
			bottom: 2px;
			content: "";
			display: inline-block;
			width: 20px;
			height: 20px;
			border: 1px solid $color-ds25;
			box-sizing: border-box;
			border-radius: 10px;

		}

		&:after {
			position: absolute;
			left: 4px;
			bottom: 6px;
			content: "";
			display: inline-block;
			width: 12px;
			height: 12px;
			border-radius: 10px;
			background: transparent;
			-webkit-transition: right .4s ease;
			-o-transition: right .4s ease;
			transition: right .4s ease;
		}
	}
}

.input-radio {
	display: none;

	&:checked+.label-radio__text {
		color: $color-ds75;

		&:before {
			border: 1px solid $color-purple;
		}

		&:after {
			background: $color-purple-gradient;
		}
	}


}

sources.components\\toggle\\toggle.scss:
.label-toggle {
	display: block;
	min-width: 200px;
	cursor: pointer;
	padding-left: 50px;
	position: relative;
	margin-top: 13px;

	&__text {
		line-height: 20px;

		&:after {
			content: "";
			display: inline-block;
			position: absolute;
			width: 12px;
			height: 12px;
			top: 4px;
			left: 4px;
			background: $color-ds25;
			border-radius: 10px;
			transition: right 0.4s ease;
		}

		&:before {
			content: "";
			position: absolute;
			left: 0;
			display: inline-block;
			width: 40px;
			box-sizing: border-box;
			border-radius: 10px;
			height: 20px;
			border: 1px solid $color-ds25;
			box-sizing: border-box;
			border-radius: 10px;
			transition: all 0.4s ease;
		}
	}
}

.label-toggle__input {
	display: none;

	&:checked+.label-toggle__text {
		border-color: $color-purple;

		&:after {
			left: 24px;
			background: $color-purple-gradient;
		}

		&:before {
			border-color: $color-purple;
		}

	}
}

