	border-radius: 4px;
	margin-bottom: 40px;
	overflow: hidden;
	padding-bottom: 20px;

	&__header {
		height: 150px;
		position: relative;
	}

	&__header-shadow {
		position: absolute;
		top: 0;
		left: 0;
		bottom: 0;
		right: 0;
		content: "";
		background: linear-gradient(to right, rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0) 15%, rgba(0, 0, 0, 0) 85%, rgba(0, 0, 0, 0.5) 100%);
	}

	&__header-arrow-left,
	&__header-arrow-right {
