		top: 53px;
		left: 8px;
		font-size: 24px;
		line-height: 24px;
		color: #fff;
		padding: 10px;
		cursor: pointer;
		transition: all 0.4s ease;
	}

	&__header-arrow-right {
		left: auto;
		right: 8px;
	}

	&__header-pagination {
		position: absolute;
		right: 15px;
		bottom: 7px;
	}

	&__title {
